import React from 'react';
import photo from '../files/headshot.jpg';
import linkedinLogo from '../files/linkedin.svg'
import emailLogo from '../files/email.svg';
import cv from '../files/rast_CV.pdf';
import {
    AboutPageContainer,
    Photo,
    PhotoBackground,
    AboutContent,
    AboutText,
    Name,
    DownloadCV,
    Divider,
    SocialLinks
} from './about.styled'

const About = () => {
    return (
        <AboutPageContainer>
            <PhotoBackground />
            <Photo src={photo} alt="Jacob Rast Picture" width="200px" height="200px"></Photo> 
            <AboutContent>
                <Name>Jacob Rast </Name>
                <SocialLinks><img src={linkedinLogo} alt="Jacob Rast Linkedin" width="30px" height="30px"/></SocialLinks> 
                <SocialLinks> <img src={emailLogo} alt="Jacob Rast Email" width="30px" height="30px"/></SocialLinks>    
                <AboutText>Hello, I'm Jacob. Master student in Biomedical Engineering at Carnegie Mellon University. Clean, and well nourished.</AboutText>
                <DownloadCV href={cv} download="rast_CV.pdf">Download CV</DownloadCV>
            </AboutContent>
            <Divider/>
        </AboutPageContainer>
    )
}

export default About;
